import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const Posts = () => {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    let ignore = false;
    fetchUsers();
    async function fetchUsers() {
      const res = await axios.get(
        "https://64cb8f7f700d50e3c7061cf4.mockapi.io/api/users"
      );
      if (!ignore) {
        setPosts(res.data);
      }
    }
    return () => {
      ignore = true;
    };
  }, []);
  return (
    <div className="w-screen h-auto bg-black">
      <div className="h-auto w-[90%] mx-auto ">
        <h1 className="text-2xl px-10 py-5 text-white text-center">
          <span className="border border-white  px-10 py-5">Users</span>
        </h1>
        <ol className=" list-disc flex flex-col space-y-4">
          {posts.map((item, id) => {
            return (
              <Link to={`/user/${id + 1}`}>
                <li className="text-white px-5 py-4">{item}</li>
                <hr />
              </Link>
            );
          })}
        </ol>
      </div>
    </div>
  );
};

export default Posts;
